import lift from './res/girl-lift.png'
import railing from './res/railing.png'
import sky from './res/sky.png'
import terrace from './res/terrace.jpg'
import './App.css';
import { Parallax, ParallaxLayer } from '@react-spring/parallax';

function App() {
  return (
    <div>
    <Parallax pages={4}>
      <ParallaxLayer
        offset={0}
        speed={1}
        factor={2}
        style={{
          backgroundImage: `url(${terrace})`,
          backgroundSize: '200%',   
        }}
      />

      <ParallaxLayer
        offset={2}
        speed={1}
        factor={4}
        style={{
          backgroundImage: `url(${sky})`,
          backgroundSize: 'cover',
        }}
      ></ParallaxLayer>

      <ParallaxLayer
        sticky={{ start: 0.9, end: 2.5 }}
        style={{ textAlign: 'center' }}
      >
        <img src={lift} />
      </ParallaxLayer>

      <ParallaxLayer
        offset={0.2}
        speed={0.05}
      >
        <h2>Welcome to my website</h2>
      </ParallaxLayer>

      <ParallaxLayer
        offset={3}
        speed={2}
      >
        <h2>Hi Mom!</h2>
      </ParallaxLayer>
    </Parallax>
  </div>
  );
}

export default App;
